import React from "react";
import Boxes from "./Boxes";
import FollowUs from "./FollowUs";
import HomeImg from "./HomeImg";
import { useEffect, useState } from "react";
import axios from "axios";
function Home() {
  const [imgMc, setimgMc] = useState([]);

  const fetchCouses = async () => {
    try {
      const response = await axios.get("http://localhost:3004/homeImg");
      setimgMc(response.data);
      console.log(response.data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchCouses();
  }, []);
  return (
    <div>
      <div>
        <HomeImg imgMc={imgMc} />
      </div>
      <Boxes />
      <FollowUs />
    </div>
  );
}

export default Home;
